import React from 'react';
import PropTypes from 'prop-types';
import { useSpring } from 'react-spring'
function transitionlearn(props) {
  const Fade = () => {
    useSpring({
      from: {
        opacity: 0
      },
      to: {
        opacity: 1
      }
    })
  }
  return (
    <div>
      <h1>Hello world</h1>
    </div>
  );
}

export default transitionlearn;
